            <div class="title top">
                <h2><span class="blue">Буклеты</span></h2>
            </div>

            <p>Другое название евробуклета — лифлет, согнутый в двух местах по вертикали лист бумаги размера А4. В сложенном виде 10×21 см. Информация на буклете может быть самая разнообразная и может содержать в себе как информацию о продукте, бренде, компании или событии, так и полезную обучающую информацию, или информацию презентующею продукцию или компанию, а так же буклеты используют как  персональное или общее приглашение на различные события.</p>

            <p>Так же буклеты могут разделяться на несколько типов: информационные, образовательные, имиджевые, почтовые, акционные и пригласительные.</p>

            <p>В нашем центре мы предлагаем печать буклетов двумя способами. 1. Цифровая печать. Ее преимуществом является скорость печати и возможность разместить разную информацию на буклетах. Обычно используется для печати малых тиражей. <br>
            2. Офсетная печать.  Ее главным преимуществом является низкая стоимость в расчете за 1 единицу. Обычно используется при печати больших тиражей.</p>

            <p>Цены на печать и изготовление буклетов зависят от: тиража, способа изготовления, вида и плотности бумаги, использования постпечатной обработки (биговка, фальцовка). <br>
            Для расчета стоимости обращайтесь к нашим менеджерам. </p>
